svg.script:
var opepenBody = document.getElementById('opepenBody');
var circles = document.getElementById('circles');
var opepen = document.getElementById('opepen');
var emojis = document.getElementById('emojis');
var circlesHide = document.querySelectorAll('.tooltip-circle');

circles.style.opacity = "1";
circles.style.visibility = "visible";
emojis.style.opacity = "1";
emojis.style.visibility = "visible";

opepen.style.opacity = "0";
opepen.style.visibility = "hidden";

function toggleVis(element) {
    if (window.getComputedStyle(element).opacity === "0") {
        element.style.visibility = "visible";
        requestAnimationFrame(() => {
            element.style.opacity = "1";
        });

        if (element === circles) {
            document.querySelectorAll('#circles > *, #circles .freedom').forEach(child => {
                child.style.visibility = '';
            });
        }
    } else {
        element.style.opacity = "0";
        element.addEventListener('transitionend', function handler() {
            element.style.visibility = "hidden";
            element.removeEventListener('transitionend', handler);
        }, { once: true });
    }
}

let opepenTimeout = null;
function debounce(func, delay) {
    if (opepenTimeout) return;
    func();
    opepenTimeout = setTimeout(() => {
        opepenTimeout = null;
    }, delay);
}

opepenBody.addEventListener('click', function() {
    debounce(function() {
        toggleVis(circles);
        toggleVis(emojis);
        toggleVis(opepen);
    }, 800);
});

document.querySelectorAll('circle.tooltip-circle, path.tooltip-circle').forEach(function(element) {
    element.addEventListener('mouseover', function(e) {
        var textElement = document.querySelector('text.username');
        var fillColor = element.getAttribute('fill');
        textElement.textContent = element.getAttribute('data-tooltip');
        if (fillColor === '#0A0A0A') {
            textElement.setAttribute('fill', '#FFFFFF'); // White color
        } else {
            textElement.setAttribute('fill', fillColor);
        }
    });

    element.addEventListener('mouseout', function() {
        var textElement = document.querySelector('text.username');
        textElement.textContent = '';
        textElement.removeAttribute('fill');
    });
});

function hideElement(event) {
    event.currentTarget.style.visibility = 'hidden';
}

circlesHide.forEach(function(circle) {
    circle.addEventListener('click', hideElement);
});

function hideElement(event) {
    event.currentTarget.style.visibility = 'hidden';

    if (event.currentTarget.getAttribute('data-tooltip') === "@FreedomToType") {
        document.querySelectorAll('.freedom').forEach(function(freedomElement) {
            freedomElement.style.visibility = 'hidden';
        });
    }
}

document.querySelectorAll('.tooltip-circle').forEach(function(circle) {
    circle.addEventListener('click', hideElement);
});
